import React from "react";
import styled from "styled-components";
import {
    Link
  } from "react-router-dom"

function SingIn() {
  return (
    <Wrapper>
      <PageTitle>

        <Link to="/" className="link">
        <span>

        bitermoscoffe

        </span>
        </Link>
      </PageTitle>

      <SingInContainer>
      <div className="title">
      Giri≈ü Yap


      </div>

      </SingInContainer>
    </Wrapper>
  );
}
const Wrapper = styled.div`
  position: relative;
  display: flex;
  justify-content: center;
  align-items: center;

  flex-direction: column;

  max-width: 472px;
  width: 100%;
  margin: 60px auto;
  color: #484848;
`;

const PageTitle = styled.div`
  .link{
      text-decoration:none;
    span {
    font-size: xx-large;
    font-weight: 700;
    color: #6f4e37;
  }
  }

`;

const SingInContainer = styled.div`
  position: relative;
  display: flex;
  justify-content: center;
  align-items: center;

  flex-direction: column;
  padding: 72px;
  border: 1px solid #e5e5e5;
  border-radius: 8px;
  max-width: 472px;
  width: 100%;
  margin: 50px auto;
  color: #484848;
  .withSocialMedia {
    .socialMediaIcon {
      display: flex;
      flex-direction: row;
      margin-top: 18px;
      margin-bottom: 18px;
      justify-content: space-evenly;

      .googleIcon,
      .facebookIcon {
        display: flex;

        justify-content: center;
        align-content: center;
        border-radius: 4px;

        height: 100%;
        border: 1px solid lightgray;
        :hover {
          cursor: pointer;
        }

        img {
          padding-left: 5px;

          width: 50px;
          height: 50px;
        }
      }
    }
  }
`

export default SingIn;
